INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (1, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 1, 1, 1.5, 0, 101, 160, 105, 0, 1, 110, 122601, 0.029);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (2, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 0, 3, 2.5, 1, 102, 120, 111, 0, 2, 105, 122401, 0.014);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (3, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 0, 2, 2.5, 0, 103, 350, 105, 1, 3, 110, 122501, 0.017);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (4, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 0, 3, 1.5, 1, 104, 130, 105, 0, 4, 110, 107501, 0.016);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (5, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 1, 1, 2.5, 0, 105, 160, 105, 0, 5, 110, 107601, 0.014);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (6, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 0, 2, 3.5, 0, 106, 255, 103, 1, 6, 120, 107801, 0.029);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (7, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 1, 1, 3.5, 0, 107, 160, 103, 0, 7, 120, 110601, 0.013);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (8, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 0, 2, 2.5, 0, 108, 350, 103, 1, 8, 110, 110401, 0.014);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (9, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 0, 3, 1.5, 1, 109, 130, 100, 0, 9, 105, 110501, 0.012);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (10, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 1, 1, 2.5, 0, 110, 200, 103, 0, 10, 105, 115701, 0.014);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (11, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 0, 2, 2.5, 0, 111, 350, 103, 1, 11, 105, 113601, 0.071);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (12, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 0, 3, 1.5, 1, 112, 130, 103, 0, 12, 120, 107901, 0.014);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (13, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 1, 2, 1.5, 0, 113, 200, 105, 0, 13, 110, 108001, 0.022);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (14, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 1, 1, 2.5, 0, 114, 160, 108, 0, 14, 110, 110301, 0.031);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (15, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 0, 1, 0.5, 1, 115, 130, 105, 0, 15, 110, 107701, 0.036);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (16, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 0, 2, 3.5, 0, 116, 350, 95, 1, 16, 110, 113101, 0.048);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (17, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 0, 3, 1.5, 1, 117, 130, 105, 0, 17, 105, 113301, 0.043);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (18, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 0, 2, 1.5, 1, 118, 130, 95, 0, 18, 105, 113201, 0.018);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (19, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 1, 2, 2.5, 0, 119, 160, 108, 0, 19, 110, 117001, 0.021);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (20, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 0, 1, 2.5, 0, 120, 255, 105, 1, 20, 110, 113501, 0.036);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (21, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 0, 3, 2.5, 0, 121, 350, 105, 1, 21, 105, 113401, 0.02);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (22, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 0, 1, 2.5, 1, 122, 130, 105, 0, 22, 110, 110101, 0.018);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (23, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 1, 3, 3.5, 0, 123, 160, 111, 0, 23, 105, 110001, 0.03);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (24, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 0, 1, 1.5, 1, 124, 130, 103, 0, 24, 110, 117201, 0.027);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (25, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 1, 2, 3.5, 0, 125, 160, 108, 0, 25, 105, 117301, 0.02);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (26, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 0, 3, 2.5, 0, 126, 350, 105, 1, 26, 110, 117401, 0.04);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (27, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 0, 1, 3.5, 0, 127, 350, 105, 1, 27, 110, 117101, 0.009);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (28, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 0, 1, 3.5, 0, 128, 255, 105, 1, 28, 120, 122901, 0.022);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (29, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 0, 3, 2.5, 1, 129, 130, 105, 0, 29, 110, 122801, 0.028);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (30, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 1, 2, 3.5, 0, 130, 130, 108, 0, 30, 105, 122701, 0.023);
